        console.log('changeTrafficLights');
    }
  return (
    <div className='traffic-lights'>
        <button onClick={changeTrafficLights}>Next</button>
        <div>
            <div className='red'></div>
            <div className='yellow'></div>
            <div className='green'></div>
        </div>
    </div>
  )
}

